⚡#ЭкономияЭнергии. Возобновляемая энергия. Гидроэнергетика.

🇷🇺 Россия располагает значительным гидроэнергетическим потенциалом, что определяет широкие возможности развития гидроэнергетики. На ее территории сосредоточено около 9% мировых запасов гидроэнергии.

💧 Мы занимаем второе место в мире после Китая. На сегодня освоено около 20% имеющегося гидроэнергетического потенциала России: на Европейскую часть приходится 46,8%, на Сибирь - 21,7%, на Восток России - 3,8%.

💧 У гидроэнергетики есть неоспоримые преимущества:
- Экологичность. Энергия вырабатывается без вредных выбросов;
- Возможность строительства мощных электростанций при соответствующих природных условиях;
- Гибкость производства. Плотины позволяют регулировать интенсивность потока воды и конечную выработку электроэнергии, а электростанции легко адаптируются к уровню энергопотребления;
- Безопасность. На ГЭС нет риска взрыва с тяжелыми последствиями.

💧 Но есть и минусы:
- Цена на строительство;
- Возведение гидроэлектростанций плотинного типа нарушает естественную экосистему, так как затапливаются огромные участки суши;
- Отсутствие дождей может привести к полному прекращению выработки электроэнергии, а также к проблемам в энергосистеме;
- Большинство мест, благоприятных для строительства мощных гидроэлектростанций, уже использованы.

💧 Для будущего развития гидроэнергетики в России предпочтительны два способа использования ГЭС:
- Строительство малых гидроэлектростанций, использующих природное течение рек;
- Применение энергии морских волн и приливов, но об этом позже 😉

