Льгота по оплате ЖКХ — это скидка на оплату жилищных и коммунальных услуг. 
Льготы положены некоторым категориям граждан и бывают федеральными (семьи погибших военнослужащих (60%), инвалиды всех групп, а также семьи с детьми-инвалидами, ветераны, ликвидаторы радиационных аварий (50%) и т.д.) и региональными.
В регионах к основным группам льготников добавляют свои. К ним могут причислять: многодетные и малообеспеченные семьи; детей-сирот; пенсионеров; ветеранов труда и др.
Уточнить, имеете ли вы право на льготу, можно на сайте «Госуслуги» либо обратившись в МФЦ г.Москвы.
В случае, когда у одного гражданина законно несколько видов льгот, он может получить только одну скидку по выбору и она может быть использована только на одну квартиру.
