С начала года Мосжилинспекция выдала 73 лицензии на управление многоквартирными домами.

С 2015 года деятельность по управлению многоквартирными домами осуществляется управляющими организациями на основании лицензии на осуществление предпринимательской деятельности по управлению многоквартирными домами, выданной органом государственного жилищного надзора на основании решения лицензионной комиссии города Москвы.

Лицензионная комиссия осуществляет свою деятельность в форме заседаний, на которых принимает решение о предоставлении лицензии или об отказе в предоставлении лицензии на осуществление предпринимательской деятельности по управлению многоквартирными домами. 

В Москве за прошедшие 5 лет 1299 организаций получили право на управление многоквартирными домами. В то же время за этот период с рынка управления многоквартирными домами по решению суда ушли 306 управляющих организаций. 

В настоящее время в столице 586 организаций реально управляют многоквартирными домами. 

В этом году по решению Лицензионной комиссии надзорным органом выдано 73 лицензии. В период действия режима самоизоляции, связанного с неблагоприятной эпидемиологической обстановкой в Москве, рассмотрение заявок от организаций на получение лицензий не приостанавливалось и осуществлялось в дистанционном формате. 

