Оформить субсидию можно, обратившись в Центры государственных услуг г.Москвы «Мои документы» (МФЦ) любого района г.Москвы или через Интернет на Портале государственных услуг г.Москвы (www.mos.ru/services).

Перед обращением в МФЦ или на Портал госуслуг г.Москвы приготовьте вот такие документы:
- Паспорта заявителя и членов его семьи (свидетельство о рождении, для лиц не достигших возраста 14 лет);
- Реквизиты банка и номер банковского счета (или социальной карты москвича) для перечисления субсидии;
- Справки о доходах заявителя и членов семьи за 6 последних календарных месяцев (не требуются для неработающих пенсионеров) или документы, подтверждающие уважительную причину отсутствия доходов.

В большинстве случаев этих документов достаточно.

