В настоящее время в столице 586 организаций реально управляют многоквартирными домами. 

В этом году по решению Лицензионной комиссии надзорным органом выдано 73 лицензии. В период действия режима самоизоляции, связанного с неблагоприятной эпидемиологической обстановкой в Москве, рассмотрение заявок от организаций на получение лицензий не приостанавливалось и осуществлялось в дистанционном формате. 

К очередному заседанию лицензионной комиссии были подготовлены мотивированные предложения по 13 соискателям лицензий на осуществление предпринимательской деятельности по управлению многоквартирными домами в Москве. 

