Правила поведения при встрече с лисицей? 

Не надо: 

- Паниковать; 

- Подходить; 

- Гладить; 

- Кормить; 

- Делать резких движений; 

- Махать руками; 

- Поворачиваться спиной; 

- Смотреть в глаза; 

- Убегать. 

Важно! Первыми лисы не нападают. Спровоцировать их можем только мы сами. 

Надо: 

- Замереть; 

- Дождаться, когда лиса убежит; 

- Постучать палкой по стволу дерева; 

- Медленно уйти. 

В случае укуса: 

- Обработать рану антисептиком; 

- Обратиться к врачу. 

