Правила пользования и нормы пожарной безопасности на пикниковых точках 



Нельзя: 

Готовить пищу (на мангалах, открытом огне, газовых горелках и т.д.) вне специально оборудованных площадок; 

Разводить костры в неустановленных местах и допускать падения углей и других горящих вещей на землю; 

Оставлять горящий уголь без присмотра. После приготовления пищи необходимо залить его водой до полного прекращения тления, а затем утилизировать; 

Оставлять мусор. Его надо собрать в пакеты и, покидая пикниковую точку, выбросить в мусорный контейнер; 

Выбрасывать остатки еды на землю; 

Пользоваться пиротехникой; 

Выжигать траву; 

Повреждать деревья и кустарники; 

Курить и бросать непотушенные окурки на землю; 

Заезжать на территорию на автомобиле или мотоцикле; 

Кидать на землю горящие спички. 

Нарушение установленных правил влечет за собой наложение административного штрафа от 4 тысяч рублей.  



