Что делать, если в лесу начался пожар? 

Необходимо сначала позвонить: 

• с любого телефона — 112; 

• с мобильного телефона — 101; 

• с городского телефона — 01, 101. 



До приезда пожарных нужно пытаться потушить огонь самостоятельно: 

сбить пламя зелеными (не сухими!) ветками лиственных деревьев 

закидать пламя землей; 

затоптать пламя ногами; 

залить пламя водой.
